rules.text:
Prisa.
Este tiene la habilidad de arrollar mientras tenga un contador -1/-1 sobre él.
Persistir. {i}(Cuando esta criatura vaya a un cementerio desde el juego, si no tenía contadores -1/-1 sobre ella, regrésala al juego bajo el control de su propietario con un contador -1/-1.){/i}

En cuanto entre, puedes pagar 3 vidas. Si no lo haces, entra girado.
{T}: Agrega {R}.{flavor}“La forma más segura de cruzar los aerocolmillos es por aire. El Paso de los Martillos es la segunda opción, pero es bastante menos segura”.
—Samila, Casa expedicionaria de Murasa{lns}

Entra al campo de batalla girado.
{T}: Agrega {R}.{flavor}“El camino hacia los precipicios consiste en curvas escarpadas y subidas tambaleantes que levantaron los elfos, mantuvieron los humanos y vigilaron los ogros. Pero es la mejor ruta para ir al centro de Murasa”.
—Samila, Casa expedicionaria de Murasa{lns}

Entra al campo de batalla girada.
{T}: Agrega {R}.{flavor}“Todavía puedo oír el eco de sus martillos, aunque pararon hace mucho”.
—Tars Olan, místico fragua de piedra{lns}

{fontsize8pt}La Cueva olvidada entra al campo de batalla girada.
{T}: Agrega {R}.
Ciclo {R}. {i}({R}, descartar esta carta: Roba una carta.){/i}
